Sometimes you just don’t have words for the beauty right in front of your eyes. I was thinking about hope and redemption tonight on the eve of Jesus’s resurrection. He died so we could live, so we could have hope, and patiently wait for the joy He desires to bring us. A landslide of love you might say, today creation reminded me of love and what better things God has in store for His children. What a savior ya know
